var title_f38_48_39691="Conflict resolution";
var content_f38_48_39691=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Six steps to conflict resolution for adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       1. Keep your temper; stay calm.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       Anger increases the heart rate and initiates a \"fight-or-flight\" response.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       2. Understand what triggers fighting.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       3. Understand that sometimes people use fighting to make themselves feel better.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       Remember that the other person is upset and wants to use fighting to solve the problem.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       The provocation is a response to their need, not to an irrevocable circumstance.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       Don't get manipulated into fighting because they want you to fight to solve their problem.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       4. Understand that the other person is a decent human being.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       5. Talk to the decent side of the other person instead of matching insults.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       \"This isn't worth fighting about.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       \"I have nothing against you. I don't want to fight you about this.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       \"If I have done something wrong, you can talk with me and I will apologize and try to fix it.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       \"If I haven't done anything wrong, I'll tell you that, but I don't want to settle this by fighting.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"1\">",
"       6. If these steps do not work, walk away from the situation. Try to use humor as you leave.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Stringham P. Pediatr Clin North Am 1998; 45:439.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
