var title_f38_48_39692="Infant HIV prophylaxis regimen";
var content_f38_48_39692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F85990&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F85990&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Infant antiretroviral prophylaxis for prevention of mother-to-child transmission of HIV",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"3\">",
"        <span class=\"subtitle1_left\">",
"        </span>",
"        <span class=\"subtitle1_left\">",
"        </span>",
"        <span class=\"subtitle1_left\">",
"        </span>",
"        <span class=\"subtitle1_single\">",
"        </span>",
"        For all HIV-exposed infants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Agent",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dosing",
"       </td>",
"       <td class=\"subtitle2\">",
"        Duration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        Zidovudine (ZDV)",
"       </td>",
"       <td>",
"        <p>",
"         Dose based on gestational age at birth&nbsp;and weight, initiated as soon after birth as possible and preferably within 6 to 12 hours of delivery",
"        </p>",
"        <ul>",
"         <li>",
"          <span class=\"sublist3_start\">",
"           <strong>",
"            &ge;35 weeks gestation at birth:",
"           </strong>",
"           4 mg/kg/dose orally (or, if unable to tolerate oral agents, 3 mg/kg/dose IV) every 12 hours",
"          </span>",
"         </li>",
"         <li>",
"          <span class=\"sublist3_start\">",
"          </span>",
"          <span class=\"sublist3_start\">",
"           <strong>",
"            &ge;30 to &lt;35 weeks gestation at birth:",
"           </strong>",
"           2 mg/kg/dose orally (or 1.5 mg/kg/dose IV) every 12 hours, advanced to 3 mg/kg/dose orally (or 2.3 mg/kg/dose IV) every 12 hours at age 15 days",
"          </span>",
"         </li>",
"         <li>",
"          <span class=\"sublist3_start\">",
"           <strong>",
"            &lt;30 weeks gestation at birth:",
"           </strong>",
"           2 mg/kg/dose orally (or 1.5 mg/kg/dose IV) every 12 hours, advanced to 3 mg/kg/dose orally (or 2.3 mg/kg/dose IV) every 12 hours after age&nbsp;four weeks",
"          </span>",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Birth through&nbsp;six weeks",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\" colspan=\"3\">",
"        Additional prophylaxis for HIV-exposed infants of women who received no antepartum antiretroviral prophylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Nevirapine, in addition to ZDV as shown above",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Dose based on birth weight, initiated as soon after birth as possible",
"        </p>",
"        <ul>",
"         <li>",
"          <span class=\"sublist3_start\">",
"           <span class=\"sublist3_start\">",
"           </span>",
"           <strong>",
"            Birth weight 1.5 to 2 kg:",
"           </strong>",
"           8 mg/dose orally",
"          </span>",
"         </li>",
"         <li>",
"          <span class=\"sublist3_start\">",
"           <span class=\"sublist3_start\">",
"           </span>",
"           <strong>",
"            Birth weight &gt;2 kg:",
"           </strong>",
"           12 mg/dose orally",
"          </span>",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Three&nbsp;doses in the first week of life",
"        <ul>",
"         <li>",
"          First&nbsp;dose within 48 hours of birth (birth to 48 hrs)",
"         </li>",
"         <li>",
"          Second&nbsp;dose 48 hours after&nbsp;first",
"         </li>",
"         <li>",
"          Third&nbsp;dose 96 hours after second",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Panel on Treatment of HIV-Infected Pregnant Women and Prevention of Perinatal Transmission. Recommendations for Use of Antiretroviral Drugs in Pregnant HIV-1-Infected Women for Maternal Health and Interventions to Reduce Perinatal HIV Transmission in the United States, July 31, 2012.",
"     <a href=\"file://www.aidsinfo.nih.gov/ContentFiles/PerinatalGL.pdf\">",
"      file://www.aidsinfo.nih.gov/ContentFiles/PerinatalGL.pdf",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
