var title_f38_48_39695="AV nodal physiology";
var content_f38_48_39695=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75699&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75699&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Physiology of the AV node in AF",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 184px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The atrioventricular (AV) node modulates the response between the atrium and the ventricle. In atrial fibrillation, the atrial rate is up to 600 beats per minute while the ventricular rate in response is 90 to 170 beats per minute; this difference in the rate results from several properties of the AV node that impede impulse conduction. The AV node generates a slow action potential (AP) that is mediated by calcium (Ca++) ion currents; the node is therefore slow response tissue. Parasympathetic innervation via the vagus nerve also slows conduction, while activation of the sympathetic nervous system speeds conduction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
